import React from 'react';
import logo from '../logo.svg';

const Resume = () => {
	return (
		<div>
            <header className="App-header">
                <p>
                Edit your life and save to reload.
                </p>
                <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
                >
                Learn React Resume
                </a>
            </header>
        </div>
	);
};

export default Resume;
